import React from "react";

const Home = () => {
  return (
    <section class="hero">
      <div class="hero-body">
        <div class="container">
          <h1 class="title">Hero title</h1>
          <h2 class="subtitle">Hero subtitle</h2>
        </div>
      </div>
    </section>
  );
};

export default Home;
